const useTeamList = (filter: TFilter) => {
  const [teamList, setTeamList] = useState([]);

  useEffect(() => {
    const fetchTeamList = async () => {
      const result = await fetchLocal("teams", {}, fake);
      setTeamList(result);
    };
    fetchTeamList();
  }, [filter]);

  return teamList;
};

export default useTeamList;
